from typing import List


class Solution:

    def waysToSplit(self, nums: List[int]) -> int:
        if not nums:
            return 0
        left = nums[0]
        ans = 0
        total = sum(nums)
        for i in range(1, len(nums) - 1):
            mid = nums[i]

            for j in range(i + 1, len(nums)):

                right = total - left - mid
                if left <= mid <= right:
                    ans += 1
                if mid > right:
                    break

                mid += nums[j]

            left += nums[i]
        return ans


